const baseUrl = 'http://localhost:8080/add'

@Injectable({
  providedIn: 'root'
})
export class PatientService {

  constructor(private http: HttpClient) { }

  create(data: any): Observable&lt;any&gt; {
    return this.http.post(baseUrl, data);
  }
}

</code></pre>
