Mongo query to get documents where field doees not exists, null, empty object {}, or empty array []<p>let's say I have 7 documents like this:</p>
<pre><code>// with content.id
{
   &quot;_id&quot; : 1, // I know it will be ObjectId but for simplicity here I'll set it as int
   &quot;content&quot; : {&quot;id&quot; : 1, &quot;title&quot; : &quot;some title&quot;}
}
// without content.id
{
   &quot;_id&quot; : 2,
   &quot;content&quot; : {&quot;title&quot; : &quot;some title&quot;}
}
// with content.id equal to null
{
   &quot;_id&quot; : 3,
   &quot;content&quot; : {&quot;id&quot; : null, &quot;title&quot; : &quot;some title&quot;}
}
// with empty content object
{
   &quot;_id&quot; : 4,
   &quot;content&quot; : {}
}
// with content as an empty array
{
   &quot;_id&quot; : 5,
   &quot;content&quot; : []
}
// with content equal to null
{
   &quot;_id&quot; : 6,
   &quot;content&quot; : null
}
// without content
{
   &quot;_id&quot; : 7,
}
</code></pre>
<p>and I need to get all records where we do not have <code>content.id</code> in our case all the records except of record 1.</p>
<p>I tried with</p>
<pre><code>collection.find({&quot;content.id&quot; : null});  
</code></pre>
<p>and it does not return record 1 which is correct but also does not return record with id 5, where <code>content</code> is set as an empty array</p>
<p>also, I tried with</p>
<pre><code>collection.find({&quot;content.id&quot; : {&quot;$exists&quot; : false}});  
</code></pre>
<p>in that case, it returns the record with id 5, but does not return the record with id 3, where <code>content.id</code> exists but is set to null.</p>
<p>I found that the query may work with a combination of both, like this</p>
<pre><code>collection.find({ &quot;$or&quot; : [{&quot;content.id&quot; : {&quot;$exists&quot; : false}} , {&quot;content.id&quot; : null}]});  
</code></pre>
<p>but such a query works a bit slower :(</p>
<p>Is there a better way to cover all the cases described above??</p>
<p>You may ask why I want to cover both <code>content: {}</code>, and <code>content: []</code>? because PHP sometimes converts an empty array to an object, but sometimes to an empty array, so as to not have any issues I want to cover both cases.</p>

